import React, { useState, useEffect, useCallback } from 'react';
import { useAuth } from '../contexts/AuthContext';
import { 
  ArrowUpRight,
  ArrowDownRight,
  Users, 
  FileText, 
  BarChart3, 
  Clock,
  Star,
  Activity,
  Target,
  Zap,
  Calendar,
  Download,
  Upload
} from 'lucide-react';

interface DashboardStats {
  totalMenus: number;
  totalItems: number;
  averageItemsPerMenu: number;
  recentMenus: any[];
  categoryStats: any[];
}

const Dashboard: React.FC = () => {
  const { token } = useAuth();
  const [stats, setStats] = useState<DashboardStats | null>(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);

  const fetchDashboardData = useCallback(async () => {
    try {
      setLoading(true);
      const response = await fetch('http://localhost:3001/api/dashboard', {
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json',
        },
      });

      if (response.ok) {
        const data = await response.json();
        if (data.success) {
          setStats({
            totalMenus: data.stats.totalMenus,
            totalItems: data.stats.totalItems,
            averageItemsPerMenu: data.stats.averageItemsPerMenu,
            recentMenus: data.recentMenus || [],
            categoryStats: data.categoryStats || []
          });
        } else {
          setError('Failed to fetch dashboard data');
        }
      } else {
        setError('Failed to fetch dashboard data');
      }
    } catch (error) {
      setError('Network error');
    } finally {
      setLoading(false);
    }
  }, [token]);

  useEffect(() => {
    fetchDashboardData();
  }, [fetchDashboardData]);

  const StatCard: React.FC<{ title: string; value: string | number; change?: number; icon: React.ReactNode; color: string }> = ({ 
    title, 
    value, 
    change, 
    icon, 
    color 
  }) => (
    <div className="bg-gray-800 rounded-xl border border-gray-700 p-6 hover:border-gray-600 transition-all duration-200">
      <div className="flex items-center justify-between">
        <div>
          <p className="text-sm font-medium text-gray-400">{title}</p>
          <p className="text-2xl font-bold text-white mt-1">{value}</p>
          {change !== undefined && (
            <div className="flex items-center mt-2">
              {change >= 0 ? (
                <ArrowUpRight className="w-4 h-4 text-green-400" />
              ) : (
                <ArrowDownRight className="w-4 h-4 text-red-400" />
              )}
              <span className={`text-sm font-medium ml-1 ${
                change >= 0 ? 'text-green-400' : 'text-red-400'
              }`}>
                {Math.abs(change)}%
              </span>
              <span className="text-xs text-gray-400 ml-1">from last month</span>
            </div>
          )}
        </div>
        <div className={`p-3 rounded-lg ${color}`}>
          {icon}
        </div>
      </div>
    </div>
  );

  const RecentMenuCard: React.FC<{ menu: any }> = ({ menu }) => (
    <div className="bg-gray-800 rounded-lg border border-gray-700 p-4 hover:border-gray-600 transition-all duration-200">
      <div className="flex items-center justify-between">
        <div className="flex items-center space-x-3">
          <div className="w-10 h-10 bg-blue-500/20 rounded-lg flex items-center justify-center">
            <FileText className="w-5 h-5 text-blue-400" />
          </div>
          <div>
            <h3 className="text-white font-medium">{menu.title}</h3>
            <p className="text-sm text-gray-400">{menu.items_count} items</p>
          </div>
        </div>
        <div className="text-right">
          <p className="text-xs text-gray-400">
            {new Date(menu.created_at).toLocaleDateString()}
          </p>
          <span className="inline-flex items-center px-2 py-1 rounded-full text-xs font-medium bg-green-500/20 text-green-400">
            {menu.status}
          </span>
        </div>
      </div>
    </div>
  );

  if (loading) {
    return (
      <div className="p-6">
        <div className="flex items-center justify-center h-64">
          <div className="text-center">
            <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-500 mx-auto mb-4"></div>
            <p className="text-gray-400">Loading dashboard...</p>
          </div>
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="p-6">
        <div className="bg-red-500/10 border border-red-500/20 rounded-lg p-4">
          <p className="text-red-400">{error}</p>
        </div>
      </div>
    );
  }

  return (
    <div className="p-6">
      {/* Header */}
      <div className="mb-8">
        <h1 className="text-3xl font-bold text-white mb-2">Dashboard</h1>
        <p className="text-gray-400">Welcome back! Here's what's happening with your menus.</p>
      </div>

      {/* Stats Grid */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 mb-8">
        <StatCard
          title="Total Menus"
          value={stats?.totalMenus || 0}
          change={12}
          icon={<FileText className="w-6 h-6 text-white" />}
          color="bg-blue-500/20"
        />
        <StatCard
          title="Total Items"
          value={stats?.totalItems || 0}
          change={8}
          icon={<BarChart3 className="w-6 h-6 text-white" />}
          color="bg-purple-500/20"
        />
        <StatCard
          title="Avg Items/Menu"
          value={stats?.averageItemsPerMenu || 0}
          change={-3}
          icon={<Target className="w-6 h-6 text-white" />}
          color="bg-green-500/20"
        />
        <StatCard
          title="Active Users"
          value="24"
          change={15}
          icon={<Users className="w-6 h-6 text-white" />}
          color="bg-orange-500/20"
        />
      </div>

      {/* Main Content Grid */}
      <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">
        {/* Recent Activity */}
        <div className="lg:col-span-2">
          <div className="bg-gray-800 rounded-xl border border-gray-700 p-6">
            <div className="flex items-center justify-between mb-6">
              <h2 className="text-xl font-semibold text-white">Recent Activity</h2>
              <button className="text-blue-400 hover:text-blue-300 text-sm font-medium">
                View all
              </button>
            </div>
            
            <div className="space-y-4">
              {stats?.recentMenus?.map((menu, index) => (
                <RecentMenuCard key={menu.id} menu={menu} />
              ))}
              
              {(!stats?.recentMenus || stats.recentMenus.length === 0) && (
                <div className="text-center py-8">
                  <FileText className="w-12 h-12 text-gray-500 mx-auto mb-4" />
                  <p className="text-gray-400">No menus uploaded yet</p>
                  <p className="text-sm text-gray-500 mt-1">Upload your first menu to get started</p>
                </div>
              )}
            </div>
          </div>
        </div>

        {/* Quick Actions & Insights */}
        <div className="space-y-6">
          {/* Quick Actions */}
          <div className="bg-gray-800 rounded-xl border border-gray-700 p-6">
            <h2 className="text-xl font-semibold text-white mb-4">Quick Actions</h2>
            <div className="space-y-3">
              <button className="w-full flex items-center justify-between p-3 bg-blue-500/10 border border-blue-500/20 rounded-lg text-blue-400 hover:bg-blue-500/20 transition-colors">
                <span className="font-medium">Upload Menu</span>
                <Upload className="w-4 h-4" />
              </button>
              <button className="w-full flex items-center justify-between p-3 bg-purple-500/10 border border-purple-500/20 rounded-lg text-purple-400 hover:bg-purple-500/20 transition-colors">
                <span className="font-medium">View Insights</span>
                <BarChart3 className="w-4 h-4" />
              </button>
              <button className="w-full flex items-center justify-between p-3 bg-green-500/10 border border-green-500/20 rounded-lg text-green-400 hover:bg-green-500/20 transition-colors">
                <span className="font-medium">Export Data</span>
                <Download className="w-4 h-4" />
              </button>
            </div>
          </div>

          {/* Category Distribution */}
          <div className="bg-gray-800 rounded-xl border border-gray-700 p-6">
            <h2 className="text-xl font-semibold text-white mb-4">Top Categories</h2>
            <div className="space-y-3">
              {stats?.categoryStats?.slice(0, 5).map((category, index) => (
                <div key={category.category} className="flex items-center justify-between">
                  <div className="flex items-center space-x-3">
                    <div className="w-2 h-2 rounded-full bg-blue-400"></div>
                    <span className="text-gray-300 text-sm">{category.category}</span>
                  </div>
                  <span className="text-white font-medium">{category.count}</span>
                </div>
              ))}
              
              {(!stats?.categoryStats || stats.categoryStats.length === 0) && (
                <p className="text-gray-400 text-sm text-center py-4">No category data available</p>
              )}
            </div>
          </div>

          {/* System Status */}
          <div className="bg-gray-800 rounded-xl border border-gray-700 p-6">
            <h2 className="text-xl font-semibold text-white mb-4">System Status</h2>
            <div className="space-y-3">
              <div className="flex items-center justify-between">
                <span className="text-gray-300 text-sm">API Status</span>
                <span className="inline-flex items-center px-2 py-1 rounded-full text-xs font-medium bg-green-500/20 text-green-400">
                  Online
                </span>
              </div>
              <div className="flex items-center justify-between">
                <span className="text-gray-300 text-sm">Database</span>
                <span className="inline-flex items-center px-2 py-1 rounded-full text-xs font-medium bg-green-500/20 text-green-400">
                  Connected
                </span>
              </div>
              <div className="flex items-center justify-between">
                <span className="text-gray-300 text-sm">AI Engine</span>
                <span className="inline-flex items-center px-2 py-1 rounded-full text-xs font-medium bg-green-500/20 text-green-400">
                  Active
                </span>
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Performance Metrics */}
      <div className="mt-8 grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
        <div className="bg-gray-800 rounded-xl border border-gray-700 p-6">
          <div className="flex items-center space-x-3 mb-4">
            <div className="w-8 h-8 bg-blue-500/20 rounded-lg flex items-center justify-center">
              <Activity className="w-4 h-4 text-blue-400" />
            </div>
            <div>
              <p className="text-sm font-medium text-gray-400">Processing Time</p>
              <p className="text-lg font-bold text-white">2.3s</p>
            </div>
          </div>
          <div className="w-full bg-gray-700 rounded-full h-2">
            <div className="bg-blue-500 h-2 rounded-full" style={{ width: '75%' }}></div>
          </div>
        </div>

        <div className="bg-gray-800 rounded-xl border border-gray-700 p-6">
          <div className="flex items-center space-x-3 mb-4">
            <div className="w-8 h-8 bg-green-500/20 rounded-lg flex items-center justify-center">
              <Zap className="w-4 h-4 text-green-400" />
            </div>
            <div>
              <p className="text-sm font-medium text-gray-400">Success Rate</p>
              <p className="text-lg font-bold text-white">98.5%</p>
            </div>
          </div>
          <div className="w-full bg-gray-700 rounded-full h-2">
            <div className="bg-green-500 h-2 rounded-full" style={{ width: '98.5%' }}></div>
          </div>
        </div>

        <div className="bg-gray-800 rounded-xl border border-gray-700 p-6">
          <div className="flex items-center space-x-3 mb-4">
            <div className="w-8 h-8 bg-purple-500/20 rounded-lg flex items-center justify-center">
              <Star className="w-4 h-4 text-purple-400" />
            </div>
            <div>
              <p className="text-sm font-medium text-gray-400">Accuracy</p>
              <p className="text-lg font-bold text-white">94.2%</p>
            </div>
          </div>
          <div className="w-full bg-gray-700 rounded-full h-2">
            <div className="bg-purple-500 h-2 rounded-full" style={{ width: '94.2%' }}></div>
          </div>
        </div>

        <div className="bg-gray-800 rounded-xl border border-gray-700 p-6">
          <div className="flex items-center space-x-3 mb-4">
            <div className="w-8 h-8 bg-orange-500/20 rounded-lg flex items-center justify-center">
              <Clock className="w-4 h-4 text-orange-400" />
            </div>
            <div>
              <p className="text-sm font-medium text-gray-400">Uptime</p>
              <p className="text-lg font-bold text-white">99.9%</p>
            </div>
          </div>
          <div className="w-full bg-gray-700 rounded-full h-2">
            <div className="bg-orange-500 h-2 rounded-full" style={{ width: '99.9%' }}></div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
